import logo from './logo.svg';
import './App.css';
import {useState} from 'react'

function MyButton(count, onClick) {
  return (
    <button className="Button" onclick={onClick}>I'm a button and i clicked {count} times</button>
  );
}

const [clickCount, setClickCount] = useState(5);

function incrementCount() {
  setClickCount(count + 1);
} 

export default function App() {
  return (
    <div className="App">
      <div>
        <h1>{user.name}</h1>
      </div>
      <div>
        <img src={user.imageUrl}
        className="App-logo" 
        alt={"react logo" + user.name}
        style={{
          width: user.imageSize,
          height: user.imageSize
        }}></img>
      </div>
      <MyButton count = {count} onClick = {incrementCount}/>
      <MyButton count = {count} onClick = {incrementCount}/>
    </div>
  );
}
